import React, {Component} from "react"
import styled from 'styled-components'
import Group from './Group.png';




class Home extends Component {
  render(){
  return (


   <div>
     <br/>
    <PictureContainer className ="kimberly-pic">
      <img className ="group" src={Group} class="kimberly-pic"/>

    </PictureContainer>



    <Text>
    Hello my name is Kimberly :)
    </Text>


    <AboutMe>
    <div className ="about-background">
    <div className = "title">
      About me
    </div>

    <div className = "kimberly-description">
      I am a rising 3rd year at the University of Virginia majoring in Computer Science and Psychology.
    </div>
    </div>
    </AboutMe>

    <br/>

    <UXJourney>
    <div className = "journey-background">
    <div className = "title">
      journey
    </div>
    </div>
    </UXJourney>


    </div>
  );
  }
}

export default Home;


const PictureContainer = styled.picture`
.kimberly-pic{
  padding-top: 3rem;
  padding-bottom: 3rem;
  margin-left: 5%;
  margin-right: auto;
  width: 50%;

}
`
const Text = styled.text`
  allign: inline-block;
  color: #4F4F4F;
  margin-left: auto;
  margin-right: auto;
  width: 20%;
  font-size: 3vw;
`

const AboutMe = styled.text`
.about-background{
  background: #FAA381;
  width: 60%;
}
.title{
  padding:1vw;
  font-size: 3vw;
}
.kimberly-description{
  padding:1vw;
  font-size: 2vw;
}

`
const UXJourney = styled.text`
.journey-background{
  justify-content: flex-end;
  background: #FAA381;
  width: 60%;
}
.title{
  padding:1vw;
  font-size: 3vw;
}
`
